pragma solidity ^0.5.0;

import './CollateralPool.sol';

contract CollatPoolRegister {
    uint public lastPoolId;
    mapping (uint => address) public poolOwners;
    mapping (uint => address) public pools;


    constructor() public {}

    function createNewPool(uint duration) public payable returns(address) {
        lastPoolId++;
        CollateralPool newPool = new CollateralPool(lastPoolId, msg.sender, duration);    // creates new collateralpool
        pools[lastPoolId] = address(newPool);                                   // adds poolId to pools mapping
        poolOwners[lastPoolId] = msg.sender;                                    // adds pool owner to poolOwners mapping
        address(newPool).call.value(address(this).balance)("");                 // transfer funds to pool
        return (address(newPool));                                              // returns new pool address
        // TODO
        // Details of exposure layer
        // Convert mappings to mappings of arrays (multiple collateral pools per address)
    }
}
